        Alasan tidak/belum pernah bersekolah atau tidak bersekolah lagi:

1. Tidak ada biaya, apabila responden atau keluarganya tidak mampu menyediakan biaya pendidikan;

2. Bekerja/mencari nafkah adalah bekerja dengan maksud untuk memperoleh atau membantu
memperoleh penghasilan atau keuntungan;

3. Menikah/mengurus ruta adalah apabila responden merasa sangat sibuk mengurus ruta atau tidak
pantas bersekolah setelah menikah/berkeluarga;

4. Merasa pendidikan cukup, apabila responden menganggap bekal pendidikan yang dikuasai sudah
cukup, dan tidak perlu lagi bersekolah ke kelas/tingkat/jenjang yang lebih tinggi;

5. Belum cukup umur, apabila anggota ruta yang bersangkutan umurnya belum mencukupi untuk
bersekolah;

6. Malu karena ekonomi, apabila responden merasa malu karena keadaan ekonomi keluarga;

7. Sekolah jauh, apabila responden menganggap jarak sekolah dengan tempat tinggal terlalu jauh,
sehingga sukar untuk dicapai;

8. Cacat, apabila responden menganggap dengan kecacatan yang dideritanya menjadi halangan bagi
responden untuk bersekolah;

9. Menunggu pengumuman, apabila responden sudah mendaftar sekolah namun belum ada pengumuman diterima atau tidak;

10. Tidak diterima adalah suatu keadaan dimana responden tidak memenuhi persyaratan yang ditetapkan di sekolah yang ia daftar, misalnya tidak lulus dalam ujian masuk. Persyaratan sekolah tidak mau menerima siswa yang cacat sehingga anak yang cacat tidak bisa sekolah;
